import { library } from '@fortawesome/fontawesome-svg-core'
import {faUser, faCog, faBell, faComments, faCheckCircle, faFileAlt, faPaste, faArrowLeft, faLock} from '@fortawesome/free-solid-svg-icons'

library.add(faUser, faCog, faBell, faComments, faCheckCircle, faFileAlt, faPaste, faArrowLeft, faLock);
